const Monday = ({breakfastRecipes}) => {

    function typicalBreakfast(sausageAndEgg){
        return sausageAndEgg === 'Sausage And Egg Salad'
    }

    const breakfast = breakfastRecipes.find(typicalBreakfast => {
        if(recipe.name === 'Sausage And Egg Salad'){
            return(
                <div key={recipe._id}>
                    <p>{recipe.name}</p>
                </div>
            );
        }
        return <></>
    });

    return(
        <>
        <p>Monday</p>
        <p>{breakfast}</p>
        </>
    );

}

export default Monday;
